import React from 'react';
import { BrowserRouter, Routes, Route, Link } from 'react-router-dom';
import Register from './components/Auth/Register';
import Login from './components/Auth/Login';
import DoctorList from './components/Doctors/DoctorList';
import UploadPrescription from './components/Pharmacy/UploadPrescription';

function App(){
  return (
    <BrowserRouter>
      <nav>
        <Link to="/">Home</Link> | <Link to="/doctors">Doctors</Link> | <Link to="/upload-presc">Upload Prescription</Link> | <Link to="/login">Login</Link> | <Link to="/register">Register</Link>
      </nav>
      <Routes>
        <Route path="/" element={<h2>Welcome to MediConnect</h2>} />
        <Route path="/doctors" element={<DoctorList/>} />
        <Route path="/upload-presc" element={<UploadPrescription/>} />
        <Route path="/login" element={<Login/>}/>
        <Route path="/register" element={<Register/>}/>
      </Routes>
    </BrowserRouter>
  );
}
export default App;
